const t_syscall_entry *get_syscall_entry(int syscall_number) {
    if (syscall_number < 0 || syscall_number >= sizeof(syscall_table) / sizeof(syscall_table[0])) {
        return NULL;
    }
    return &syscall_table[syscall_number];
}
